import React from 'react';
import TextField from '@material-ui/core/TextField';
import styles from './sign-out.module.css'


const  SignOutForm = ()=> {
    return(
        <div className={styles.Contaner} >
            <p>If not having account.Create account here</p>
            <form className={styles.from_container} >
            
            <TextField className= {styles.text_field}  required id="standard-required" label="Name" defaultValue="Name" />
            <TextField className= {styles.text_field}  required id="standard-required" label="Email" defaultValue="email" type="email"  />
            <TextField
                className= {styles.text_field}
                id="standard-password-input"
                label="Password"
                type="password"
                autoComplete="current-password"
            />
            <TextField
                className= {styles.text_field}
                id="standard-password-input"
                label="Confirm Password"
                type="confirm password"
                autoComplete="current-password"
            />
            
        </form>
        </div>
    )
}

export default SignOutForm;
